methods/applications/getApplications.htm.body:
List Applications
Get a list of your applications.
Request URL
GEThttps://api.catapult.inetwork.com/v1/users/{userId}/applications/{applicationId}

Supported Parameters



Parameter
Description
Mandatory




page
Used for pagination to indicate the page requested for querying a list of applications. If no value is specified the default is 0.
No


size
Used for pagination to indicate the size of each page requested for querying a list of applications. If no value is specified the default value is 25. (Maximum value 1000)
No



Properties



Property
Description




id
The unique identifier for the application.


name
A name you choose for this application.


incomingCallUrl
A URL where call events will be sent for an inbound call. This is the endpoint where the Application Platform will send all call events. Either incomingCallUrl or incomingMessageUrl is required.


incomingCallUrlCallbackTimeout
Determine how long should the platform wait for incomingCallUrl's response before timing out in milliseconds.


incomingCallFallbackUrl
The URL used to send the callback event if the request to incomingCallUrl fails.


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. Values are "get" or "post", default: "post".


autoAnswer
Determines whether or not an incoming call should be automatically answered. Default value is 'true'.


incomingMessageUrl
A URL where message events will be sent for an inbound message. This is the endpoint where the Application Platform will send all message events. Either incomingMessageUrl or incomingCallUrl is required.


incomingMessageUrlCallbackTimeout
Determine how long should the platform wait for incomingMessageUrl's response before timing out in milliseconds.


incomingMessageFallbackUrl
The URL used to send the callback event if the request to incomingMessageUrl fails.



Example 1 of 1: List your applications.
curl -v -X GET  https://api.catapult.inetwork.com/v1/users/{user-id}/account/applications \
  -u {token}:{secret} \
  -H "Content-type: application/json" \

//Promise
client.Application.list()
.then(function (response) {
    console.log(response.applications);
    if(response.hasNextPage) {
        return response.getNextPage();
    }
    else {
        return {applications: []};
    }
})
.then(function(response) {
    console.log(response.applications);
});

var applications = client.Application.List();
var firstApplication = applications.First();
Console.WriteLine($"{firstApplication.Name} - {firstApplication.Id}");
// MyFirstApp - a-12345

list = Application.list(client)
first_application = list.next
first_application_name = first_application[:name]


The above command returns JSON structured like this:

[
  {
    "id": "{applicationId}",
    "name": "MyFirstApp",
    "incomingCallUrl": "http://example.com/calls.php",
    "incomingMessageUrl": "http://example.com/messages.php",
    "autoAnswer": true
  },
  {
    "id": "{applicationId}",
    "name": "MySecondApp",
    "incomingCallUrl": "http://example.com/app2/calls.php",
    "incomingMessageUrl": "http://example.com/app2/messages.php",
    "autoAnswer": false
  }
]

methods/applications/postApplications.ht.body:
Create Application
Creates an application that can handle calls and messages for one of your phone number. Many phone numbers can share an application. For more information on how to integrate voice and messaging in your application, visit the FAQ
Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/applications/

Supported Parameters



Parameter
Description
Mandatory




name
A name you choose for this application.
Yes


incomingCallUrl
A URL where call events will be sent for an inbound call.
No


incomingCallUrlCallbackTimeout
Determine how long should the platform wait for incomingCallUrl's response before timing out in milliseconds.  Maximum Time: 10000 (10s)
No


incomingCallFallbackUrl
The URL used to send the callback event if the request to incomingCallUrl fails.
No


incomingMessageUrl
A URL where message events will be sent for an inbound SMS message
No


incomingMessageUrlCallbackTimeout
Determine how long should the platform wait for incomingMessageUrl's response before timing out in milliseconds.  Maximum Time: 10000 (10s)
No


incomingMessageFallbackUrl
The URL used to send the callback event if the request to incomingMessageUrl fails.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. (If not set the default is HTTP POST)
No


autoAnswer
Determines whether or not an incoming call should be automatically answered. Default value is 'true'.
No



Example 1 of 1: Create an application named: 'MyFirstApp'
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/applications \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
    -d \
    '
    {
        "name": "MyFirstApp",
        "incomingCallUrl": "http://example.com/calls.php",
        "incomingMessageUrl": "http://example.com/messages.php",
        "callbackHttpMethod": "GET",
        "autoAnswer": true
    }'

//Promise
client.Application.create({
    name: 'MyFirstApp',
    incomingCallUrl: 'http://your-server.com/CallCallback',
    incomingMessageUrl: 'http://your-server.com/MsgCallback'
})
.then(function (response) {
    console.log(response);
});

//Callback
client.Application.create({
    name: 'SampleApp2',
    incomingCallUrl: 'http://your-server.com/CallCallback',
    incomingMessageUrl: 'http://your-server.com/MsgCallback'
}, function (err, response) {
    if (err) {
        console.log(err);
    }
    else {
        console.log(response)
    }
});

var application = await client.Application.CreateAsync(new CreateApplicationData{
    Name = "SampleApp2",
    IncomingCallUrl = "http://your-server.com/CallCallback",
    IncomingMessageUrl = "http://your-server.com/MsgCallback"
});

Console.WriteLine($"Created application with id {application.Id}");
// Created application with id a-12345

Console.WriteLine($"{application.Instance.Name} - {application.Instance.IncomingCallUrl}");
// SampleApp2 - http://your-server.com/CallCallback

application = Application.create(client, {
    :name => "SampleApp2",
    :incoming_call_url => "http://your-server.com/CallCallback",
    :incoming_message_url => "http://your-server.com/MsgCallback"
})

