This is the caller id that will be used when the call is transferred. This parameter is only considered in transfer state.- transferring an incoming call: allowed values are 1) private 2) the incoming call from number or 3) any Bandwidth number owned by user.- transferring an outgoing call call: allowed values are 1) private or 2) any Bandwidth phone number owned by user.
