Send DTMF (phone keypad digit presses).
Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/calls/{callId}/dtmf

Supported Parameters



Parameter
Description
Mandatory




dtmfOut
String containing the DTMF characters to be sent in a call. Allows a maximum of 92 characters.The digits will be sent one-by-one with a marginal delay. Valid characters are given by the regular expression [A-D0-9#*,wW]+.- The , and lowercase w characters introduce a half-second pause into the DTMF sequence.- The W character introduces a one-second pause.Example: The DTMF string 1WWW,59# will send a 1, wait 3.5 seconds, then send 59# in quick succession.Example: The DTMF string '1Ww2Ww1Ww#' will send a '1', then '2', then '1', then '#' with a wait time of 1.5 seconds between each character sent.
