methods/messages/postMessages.html.body:
Send SMS Message(s)
Sends one or more messages.


Read More about Messaging in the FAQ



Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/messages

Supported Parameters



Parameter
Description
Mandatory




from
One of your telephone numbers the message should come from (must be in E.164 format, like +19195551212).
Yes


to
The phone number the message should be sent to (must be in E.164 format, like +19195551212).
Yes


text
The contents of the text message (must be 2048 characters or less).  Standard text messages are 160 characters. Messages larger than 160 characters are automatically fragmented and re-assembled to fit within the 160 character transport constraints.
Yes


media
For MMS messages, a media url to the location of the media or list of medias to be sent send with the message.  Check the faq to see what media types are supported
No


receiptRequested
Requested receipt option for outbound messages: none: (DEFAULT) Delivery receipt will not be sent as callback event.  all: Success or error delivery receipt maybe sent as callback event. error: Only error delivery receipt event maybe sent as callback event.  The callback will contain information about delivery   Can not send media and receiptRequested in the same request
No


callbackUrl
The server URL where the events related to the outgoing message will be sent to.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. Values are get or post Default is POST
No


callbackTimeout
Determine how long should the platform wait for callbackUrl’s response before timing out (milliseconds).  Maximum Time: 10000 (10s)
No


fallbackUrl
The server URL used to send the message events if the request to callbackUrl fails.
No


tag
Any string, it will be included in the callback events of the message.
No



Multiple Message Result Types
Important Note on Multiple Messages: There is a maximum limit of 50 messages sent per multiple messages request.



Type
Description




result
Values areaccepted - the message was accepted and the location points to the message resource  error - the message was not accepted and the “error” property contains information.


location
When the result is accepted, contains the URL of the message location.





Bandwidth returns `HTTP 201` Created with the URI of the message in the `Location` Header



Example 1 of 7: Send a single text message
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/messages \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
        -d \
    '
    {
        "from": "{fromNumber}",
        "to": "{toNumber}",
        "text": "Good morning, this is a test message",
        "callbackUrl": "http://my.callback.com"
    }'

client.Message.send({
    from : "+19195551212",
    to   : "+19195551213",
    text : "Thank you for susbcribing to Unicorn Enterprises!"
})
.then(function(message){
    console.log(message);
});
//{
//  from : "+19195551212",
//  to   : "+19195551213",
//  text : "Thank you for susbcribing to Unicorn Enterprises!",
//  id   : "..."
//}

var message = await client.Message.SendAsync(new MessageData {
    From = "+19195551212",
    To = "+19195551213",
    Text = "Thank you for susbcribing to Unicorn Enterprises!"
});

Console.WriteLine($"Created message with id {message.Id}");
// Created message with id m-1234

message = Message.create(client, {
    :from => "+19195551212",
    :to => "+19195551213",
    :text => "Thank you for susbcribing to Unicorn Enterprises!"
})


The above command returns HTTP Header structured like this:

HTTP/1.1 201 Created
Location: /v1/users/{userId}/messages/{messageId}
